import { useState } from "react";
import GetUsersItem from "./components/GetUsersItem";

function Test() {
    const [userItems, setUserItems] = useState([
        {key: 1, id: 1, name: 'Nazir', email: 'nazik@nosex.ru', phone: '78076002213', password: 'genshinimba2010'},
        {key: 2, id: 2, name: 'MEV', email: 'Mevbx@sigma.ru', phone: '7**********', password: '************'},
    ])



    return (
        <div className="App">
            {userItems.map(item => 
                <GetUsersItem item={item} />
            )}
            
        </div>
    )
}

export default Test
